// import Home from '../page/admin/Admin'
// import Login from '../page/login/Login'

let router = [
    {
        path: '/',
        name: '首页',
        components: ()=>import('../page/admin/Admin'),
        exact: true,
    },
    {
        path: '/login',
        name: '登录',
        components: ()=>import('../page/login/Login')
    }
];

export default router;
